"""Nun nutzen wir Statistik um uns zeigen zu lassen, wie viele Gruppen (oder "Cluster") wir am besten für unsere Daten erstellen sollten. Dazu nutzen wir eine Methode namens Ellbogenmethode (Elbow Method).

Stellen wir uns vor, wir hätten eine große Kiste mit Bällen in verschiedenen Farben. Wir wissen aber nicht, wie viele Farbgruppen es wirklich gibt. Der Code hilft uns das herauszufinden, indem er die Bälle immer wieder in unterschiedlich viele Gruppen sortiert und misst, wie gut die Sortierung ist.
"""

import matplotlib.pyplot as plt
from sklearn.cluster import KMeans
inertia={}
RecencyInertia = CustUnique[['Recency']]
# k wird einen Wert von 1 bis 9 annehmen. k steht für die Anzahl der Cluster (Gruppen).
for k in range(1, 10):
    # Wir sagen  "Teile unsere Daten (RecencyInertia) in k Gruppen auf". max_iter=1000 bedeutet, dass das bis zu 1000-mal versucht werden soll, bis die besten Gruppen gefunden wurden.
    kmeans = KMeans(n_clusters=k, max_iter=1000).fit(RecencyInertia)
    RecencyInertia["clusters"] = kmeans.labels_
    # Jetzt kommt die entscheidende Messung. kmeans.inertia_ ist ein Wert, der misst, wie gut die Gruppierung ist. Er wird auch "Trägheit" genannt und ist im Grunde die Summe der Quadrate der Abstände von jedem Datenpunkt zu seinem Gruppenzentrum.
    # Je kleiner dieser Wert ist, desto enger liegen die Punkte in ihren Gruppen beieinander, und desto besser ist die Gruppierung. Wir speichern diesen Wert für jede Anzahl von Gruppen (k) in unserem Wörterbuch.
    inertia[k] = kmeans.inertia_

plt.figure(figsize=(10, 6))
plt.plot(list(inertia.keys()), list(inertia.values()), marker='o')
plt.xlabel("Number of cluster", fontsize=16)
plt.ylabel("Inertia", fontsize=16)
plt.xticks(list(inertia.keys()))
plt.show();

"""Wie interpretieren wir das Ergebnis?

- Der "Ellenbogen": Wir suchen den Punkt auf der Kurve, an dem die Linie am stärksten abknickt und fast flach wird. Dieser Punkt wird "Ellenbogen" genannt.

- Die optimale Anzahl: Der Wert auf der x-Achse (Anzahl der Cluster) an diesem "Ellenbogen"-Punkt ist in der Regel die optimale Anzahl von Clustern, die wir für die Daten verwenden sollten. Denn eine weitere Erhöhung der Clusteranzahl bringt keine statistisch signifikante Verbesserung der Trennschärfe mehr.
"""

kmeans = KMeans(n_clusters=3)
kmeans.fit(CustUnique[['Recency']])
CustUnique['RecencyCluster'] = kmeans.predict(CustUnique[['Recency']])

"""- kmeans = KMeans(n_clusters=3): wir initialisieren K-Means initialisiert mit drei Gruppen (n_clusters=3) .

- kmeans.fit(CustUnique[['Recency']]): Der Algorithmus lernt die Verteilung der Recency-Daten und berechnet die optimalen Zentren für die drei Gruppen.

- CustUnique['RecencyCluster'] = kmeans.predict(CustUnique[['Recency']]): Jeder Kunde bekommt jetzt eine neue Spalte namens RecencyCluster, die eine Zahl zwischen 0 und 2 enthält. Diese Zahl gibt an, zu welcher der drei Gruppen der Kunde gehört.

# Aufgabe: Wie verhält sich die Verteilung der RecencyCluster?
"""

# Geben Sie hier Ihren Code ein...

CustUnique.groupby('RecencyCluster')['Recency'].describe()

"""CustUnique.groupby('RecencyCluster')['Recency'].describe() fasst die Recency-Daten für jede der drei Gruppen zusammen. Dadurch erhalten wir Informationen wie den Durchschnitt, den Minimal- und Maximalwert jeder Gruppe, sodass wir sehen können, wie sich die Gruppen voneinander unterscheiden (z. B. eine Gruppe mit einem niedrigen durchschnittlichen Recency ist viel aktueller als eine mit einem hohen).

# Aufgabe: handelt es sich um ein gutes (trennscharfes) Clustering?
Welche Aussagekraft haben z.B. die Clusternummern?
"""

# Geben Sie hier Ihre Gedanken ein...

def order_cluster(cluster_field_name, target_field_name,data,ascending):
    new_cluster_field_name = 'new_' + cluster_field_name
    df_new = data.groupby(cluster_field_name)[target_field_name].mean().reset_index()
    df_new = df_new.sort_values(by=target_field_name,ascending=ascending).reset_index(drop=True)
    df_new['index'] = df_new.index
    df_final = pd.merge(data,df_new[[cluster_field_name,'index']], on=cluster_field_name)
    df_final = df_final.drop([cluster_field_name],axis=1)
    df_final = df_final.rename(columns={"index":cluster_field_name})
    return df_final

"""Die Funktion order_cluster ist entscheidend, um den Clustern eine sinnvolle Bedeutung zu geben.

Was die Funktion order_cluster macht:
 K-Means hat drei Gruppen erstellt und ihnen die Nummern 0, 1 und 2 zugewiesen. Es könnte aber sein, dass Gruppe 0 die aktivsten Kunden (niedrige Recency), Gruppe 1 die mittelmäßig aktiven und Gruppe 2 die inaktiven (hohe Recency) Kunden sind. Es könnte aber auch sein, dass Gruppe 2 die aktivsten und Gruppe 0 die inaktivsten sind. Die Reihenfolge ist einfach zufällig.

Die Funktion order_cluster sortiert die Cluster neu, sodass sie eine logische Reihenfolge haben. In unserem Fall wird ascending=False verwendet, was bedeutet, dass die Gruppe mit dem höchsten Recency-Wert (die inaktivsten Kunden) die neue Nummer 0 erhält, die nächsthöchste Recency-Gruppe die 1 und so weiter. Dies macht es einfacher, die Ergebnisse zu interpretieren:

- Cluster 0: die inaktivsten Kunden (höchster Recency-Wert)

- Cluster 1: die mittelmäßig aktiven Kunden

- Cluster 2: die aktivsten Kunden (niedrigster Recency-Wert)

Die Schritte innerhalb der Funktion:

1. Berechne den Durchschnitt: Die Funktion berechnet den durchschnittlichen Recency-Wert für jeden Cluster (0, 1, 2).

2. Sortiere die Cluster: Sie sortiert diese Durchschnittswerte in absteigender Reihenfolge (ascending=False).

3. Ordne die neuen Nummern zu: Die sortierten Cluster bekommen neue Nummern (index) zugewiesen, beginnend bei 0.

4. Füge die neuen Nummern zusammen: Die ursprünglichen Daten (CustUnique) werden mit den neuen Cluster-Nummern zusammengeführt. Die alten Nummern werden verworfen.

# Aufgabe: Wenn Sie order_cluster entsprechend auf das RecencyCluster an
"""

# Geben Sie hier Ihren Code ein...
